              <p>
                <b>contact</b>@kksso.co
              </p>
              <Row>
                {" "}
                <Box height="22px" margin="medium">
                  <Image fit="contain" src="/img/logo-zoom.png" />{" "}
                  <img src="/img/logo-zoom.png" />{" "}
                </Box>
              </Row>
              <Text size="small">Kickasso, 2020</Text>
            </center>
          </Col>
        </Row>
      </Grid>
    </footer>
  );
};

export default Footer;
